/* **************** 
*   Styles       * 
******************/

export const HomeCardStyle = {
    Card: {
        width: '300px',
        height: '400px',
        marginRight: '50px',
        marginLeft: '50px',
        textAlign: 'center'
    },
    Title: {
        marginTop: '10px',
    }
}

export const ImageStyles = {
    HomeCard: {
        maxWidth: '150px',
        maxHeight: '150px',
        marginRight: 'auto',
        marginLeft: 'auto'
    },
    HomeAvatar: {
        borderRadius: '50%',
        width: '20%',
        height: 'auto'
    },
    About: {
        width: '300px',
        height: '300px',
        padding: '5px'
    },
}

export const TvpageStyle = {
    Image: {
        height: '300px',
        width: 'auto'
    },
    Title: {
        height: '20px',
        width: '200px',
        margin: 4
    },
    Cast: {
        maxHeight: '20px',
        width: '200px',
        margin: 4,
        wordWwrap: 'break-word',
        maxFontSize: '1vw'
    }
}

export const DandDStyle = {
    thumbnail: {
        position: 'relative',
        align: 'center'
    },
    Avatar: {
        height: '300px',
        width: 'auto',
    }
}

export const TplistHeader = {
    Title: {
        textAlign: 'left',
        marginTop: '10px'
    },
    Value: {
        paddingTop: '10px'
    }
}
